const lname = "Garg";
// const num = 5;
const date = new Date().toLocaleDateString();
const time = 25;
ReactDOM.render(
  <>
    <h1>
        {
          `my full name is ${fname} ${lname}`
        }
    </h1>
    <p> 
        {`todays Date is ${date}`}
    </p>
    <p> 
        {`Current time is ${time}`}
    </p>
  </>,
  document.getElementById('root'));

